import React from 'react';
import "./Card.css";

const Card = (props) => {
  return (
    <div className="card">
      <div className="group1">
        <img src={props.datalogo} alt="pic1" />
        <div className="group2">
          <div className="group2-group">
            <p className="company">{props.datacompany}</p>
            {props.new && <button className="btn1"> NEW!</button>}
            {props.featured && <button className="btn2"> FEATURED </button>}
          </div>
          <p className="title">{props.dataposition}</p>
          <p className="sub-items">{props.datapostedAt} <span> . {props.datacontract}</span> <span> . {props.datalocation}</span></p>
        </div>
      </div>
      
      <hr style={{width: "100%"}}/>
      
      <div className="categories">
          <button>{props.datarole}</button>
          <button>{props.datalevel}</button>

          {props.datalanguages.map((language, index) => (
            <button key={index}>{language}</button>
          ))}
        
          {props.datatools.map((tools, index) => (
            <button key={index}>{tools}</button>
          ))}
        
      </div>
    </div>
  )
}

export default Card;
